INSERT INTO `ogc_page_about` (`id`, `name`, `content`, `content_en`) VALUES
	(1, 'header_title', 'Cerrá los ojos y soñá, \nporque todo lo que imaginás, \npodes regalarlo con oh! Gift Card', 'Close your eyes and dream,\nbecause anything you can imagine, \nyou can give as a gift with oh! Gift Card'),
	(2, 'header_bg_image', 'video-fallback.jpg', 'video-fallback.jpg'),
	(3, 'initial_block_title', 'oh! Gift Card', 'oh! Gift Card'),
	(4, 'initial_block_subtitle', 'La experiencia de regalar', 'The experience of gifting'),
	(5, 'initial_block_text', 'Somos la compañía líder en emisión, procesamiento y comercialización de Gift Cards en Argentina. Actualmente procesamos las Gift Cards de las principales tiendas del país, y poseemos canales comerciales propios para la venta a grandes empresas como a particulares. Tenemos un enfoque único, que integra todos los servicios que componen la cadena de valor de la industria, desde la emisión, el procesamiento, la distribución y la comercialización de Gift Cards tanto físicas como virtuales.', 'We are the leading company in the processing, distribution, and marketing of gift cards in Argentina. Currently we manage the gift card programs of the most important companies in the country, we have our own sales channels dedicated to corporations and individual consumers.  Our sole focus is to provide a fully integrated approach throughout the value chain of our industry, which includes the processing, distribution and marketing of gift cards and egift cards.'),
	(6, 'initial_block_image', '01-initial.jpg', '01-initial.jpg'),
	(7, 'big_block_text', 'Imaginamos y construimos un mundo más conectado con las emociones. Encontramos en lo práctico, tecnológico e innovador una forma de inspirar felicidad. Creemos que el acto de regalar es un diferencial que nos humaniza y nos hace mejores personas.', 'We imagine and work to build a world connected by feelings.  We find that everyday technology and innovation can inspire happiness.  We believe that the act of giving a gift is an act that humanizes us and makes us better people.'),
	(8, 'video_block_title', 'oh! Gift Card, la posibilidad de elegir', 'oh! Gift Card, the power to choose.'),
	(9, 'video_block_link', 'https://www.youtube.com/watch?v=nY-T9nmr79E', 'https://www.youtube.com/watch?v=nY-T9nmr79E'),
	(10, 'about_us_block_title', 'Conocenos', 'About us'),
	(11, 'about_us_block_text', 'En oh! Gift Card todos los días nos esforzamos para seguir siendo líderes en el mundo de los regalos, ofreciendo nuevas formas de conectar las emociones y creando la comunidad de mejores marcas de la región. \nPriorizamos el trabajo en equipo, la comunicación transparente, la calidad, lo creativo, lo íntegro y honesto, pero por sobre todo la alegría y el optimismo.', 'At oh! Gift Card we work hard to continue to be the leader in the gift market, offering new ways to inspire people’s generosity and providing access to the strongest brands in the region. We value and prioritize teamwork, effective communication, quality work, creativity, integrity, honesty and above all happiness and optimism.');
