	(1, 'header_title', 'Servicio a marcas'),
	(2, 'header_text', 'Somos la única compañía especializada en la industria de Gift Cards. Establecemos con cada una de las marcas un vínculo de trabajo a largo plazo, acompañando el desarrollo del producto en todos sus aspectos.'),
	(3, 'header_button', 'Beneficios para tu marca'),
	(4, 'header_bg_image', 'ohgc_marcas_header.png'),
	(5, 'header_bg_color', '#fdb933'),
	(6, 'initial_block_title', 'Acompañamos a las mejores marcas'),
	(7, 'initial_block_text', 'Somos un equipo de trabajo flexible y proactivo, comprometido a desarrollar conjuntamente con nuestras marcas nuevas herramientas y acciones que les permitan alcanzar sus metas y objetivos comerciales dentro del programa de Gift Cards.'),
	(8, 'initial_block_image', '1200x1200.jpg'),
	(9, 'benefits_block_title', 'Beneficios para tu marca'),
	(10, 'benefits_block_text', 'Implementando un programa de Gift Cards de tu marca obtendrás una poderosa herramienta que te permitirá, entre otras cosas, captar nuevos clientes, aumentar la recurrencia de compra e incrementar tus ventas. Otorga beneficios financieros, económicos y genera valor.'),
	(11, 'benefits_block_1_title', 'Potenciá tus ventas'),
	(12, 'benefits_block_1_text', 'El 90% de las personas que llegan con una Gift Card, consumen dinero extra. El dinero extra es entre un 30% a 60% sobre el valor de la Gift Card.'),
	(13, 'benefits_block_1_button', 'Saber más'),
	(14, 'benefits_block_1_image', 'benefits-1.png'),
	(15, 'benefits_block_2_title', 'Canales comerciales'),
	(16, 'benefits_block_2_text', 'oh! Gift Card comercializa tu marca a través de diferentes canales. Tenemos una cartera de más de 100 empresas que nos compran en forma recurrente, estamos presentes en los principales catálogos de bancos del país y contamos con nuestro propio ecommerce.'),
	(17, 'benefits_block_2_button', 'Saber más'),
	(18, 'benefits_block_2_image', 'benefits-2.png'),
	(19, 'benefits_block_3_title', 'Plataforma oh! Gift Card Stores'),
	(20, 'benefits_block_3_text', 'Herramienta de control y gestión que te permitirá acceder a toda la información sobre operaciones realizadas, Gift Cards vendidas, envío de Gift Cards Virtuales y/o liquidaciones.'),
	(21, 'benefits_block_3_button', 'Saber más'),
	(22, 'benefits_block_3_image', 'benefits-3.png'),
	(23, 'stores_block_title', 'Plataforma oh! Gift Card Stores'),
	(24, 'stores_block_text', 'La plataforma oh! Gift Card Stores te ayuda a controlar toda la operatoria desde tu PC, realizar acciones comerciales con Gift Cards Virtuales, visualizar las ventas en tiempo real y gestionar ventas corporativas, entre otros.'),
