INSERT INTO `ogc_page_corporate` (`id`, `name`, `content`) VALUES
	(1, 'header_title', 'Venta a empresas'),
	(2, 'header_text', 'Acompañamos y potenciamos los programas de premios,  incentivos y fidelización brindando soluciones y productos innovadores de alto valor percibido.'),
	(3, 'header_button', 'Nuestras soluciones'),
	(4, 'header_bg_image', 'ohgc_corporativo_header.png'),
	(5, 'header_bg_color', '#54c6d3'),
	(6, 'solutions_block_title', 'Nuestras soluciones'),
	(7, 'solutions_block_text', 'Desarrollamos un modelo único que combina capital humano especializado, tecnología de última generación y flexibilidad operativa alineada con las necesidades de nuestro cliente para ofrecerle soluciones inteligentes y customizadas'),
	(8, 'solutions_block_1_title', 'Valorar colaboradores'),
	(9, 'solutions_block_1_text', 'El desafío de las compañías world class es atraer\na los mejores talentos y fidelizar a sus empleados.  '),
	(10, 'solutions_block_1_image', 'solutions-1.png'),
	(11, 'solutions_block_2_title', 'Fidelizar clientes'),
	(12, 'solutions_block_2_text', 'Creemos en las relaciones duraderas, por eso sabemos la importancia de fidelizar a los clientes. '),
