	(31, 'ogc_card_block_title', 'Tarjeta oh! Gift Card'),
	(32, 'ogc_card_block_subtitle', '¡Miles de opciones en una sola Gift Card!'),
	(33, 'ogc_card_block_text', '¡Con la tarjeta oh! Gift Card regalá la posibilidad de elegir! Tus colaboradores pueden realizar consumos parciales en todas nuestras marcas adheridas, en cualquier punto del país y hasta agotar el crédito.'),
	(34, 'ogc_card_block_button', 'Más información'),
	(35, 'ogc_card_block_image', 'side-oh-gift-card.jpg'),
