	(37, 'ogc_special_moments_block_text', 'Regalá oh! Gift Card en cualquier momento del año y sorprendé a tus colaboradores con nuestras propuestas para fechas importantes. Descubrí, motivá e innová.'),
	(38, 'ogc_special_moments_block_button', 'Más información'),
	(39, 'ogc_special_moments_block_image', 'side-special.jpg'),
	(40, 'packaging_block_title', 'Packaging'),
	(41, 'packaging_block_text', 'Con el foco puesto en los detalles y en brindar soluciones de calidad, diseñamos diferentes tipos de packaging que acompañan nuestras tarjetas. Podés personalizarlos para darle más valor e impacto.'),
	(42, 'packaging_block_button', 'Más información'),
	(43, 'packaging_block_image', 'packaging.jpg'),
	(44, 'ogc_virtual_block_title', 'Gift Card Virtual'),
	(45, 'ogc_virtual_block_subtitle', '¡Miles de opciones a tu alcance!'),
	(46, 'ogc_virtual_block_text', 'Porque no hay distancias para conectar emociones. La tecnología nos ofrece la posibilidad de regalar de manera instantánea y llegar a tus colaboradores en cualquier punto del país. Es una alternativa confiable, segura y personalizable que llega vía e-mail.'),
	(47, 'ogc_virtual_block_button', 'Más información'),
	(48, 'ogc_virtual_block_image', 'side-gcv.jpg'),
	(49, 'ogc_rewards_block_title', 'oh! Gift Card Rewards'),
	(50, 'ogc_rewards_block_text', 'Un día imaginamos una manera única e innovadora de incentivar, fidelizar y motivar a colaboradores, fuerza de venta y clientes. oh! Gift Card Rewards es una herramienta tecnológica y personalizada para gestionar de manera simple y rápida los mejores programas de beneficios y recompensas. Dales la posibilidad de elegir en un solo lugar, lo que más les gusta en una plataforma con las mejores marcas.'),
	(51, 'ogc_rewards_block_button', 'Más información'),
	(52, 'ogc_rewards_block_image', 'side-rewards.jpg'),
	(53, 'ogc_catalogs_block_title', 'Soluciones a catálogos de premios'),
	(54, 'ogc_catalogs_block_text', 'Con nuestro know how ayudamos a potenciar los mejores catálogos de premios de la región. Ofrecemos una plataforma virtual que permite al administrador del programa gestionar y enviar Gift Cards de manera instantánea. También brindamos métodos de integración simples y seguros para catálogos externos.'),
	(55, 'ogc_catalogs_block_button', 'Más información'),
	(56, 'ogc_catalogs_block_image', 'side-catalogs.jpg'),
