INSERT INTO `ogc_page_faqs` (`id`, `category`, `title`, `description`, `faq_order`) VALUES
	(1, 1, '¿Qué es una Gift Card? ¿Cómo funciona?', 'Una Gift Card es una Tarjeta de Regalo precargada que se utiliza como medio de pago para  realizar compras en los comercios adheridos. Las mismas son al portador y cuentan con una vigencia.', 1),
	(2, 2, '¿Realizan factura A para empresas?', 'Sí, realizamos facturas A.', 1),
	(4, 2, '¿Existe una Gift Card genérica que se pueda utilizar en más de una marca?', 'Ofrecemos Gift Cards virtuales que pueden ser consumidas en más de una marca. Para conocer donde utilizarla se debe ingresar los 16 dígitos del número de la Gift Card en el menú principal.', 2),
	(21, 1, '¿Qué importes tienen las Gift Cards?', 'El monto de la Gift Card lo define el comprador al momento de adquirirla. Cuentan con un monto mínimo y máximo. Dentro de ese margen podrán cargarle el saldo que se desee.', 2),
	(24, 1, '¿Dónde pueden ser utilizadas las Gift Cards?', 'Cada Gift Card es válida solamente para ser utilizada en los locales adheridos de la marca que la emite.', 2),
	(25, 1, '¿Tiene algún costo la adquisición de una Gift Card?', 'No cuenta con ningún costo adicional por compra. El único valor que paga el comprador es el monto que desea cargarle a la Gift Card.', 2),
	(26, 1, '¿Qué es el Número de Gift Card y el Código de Seguridad de la tarjeta?', 'El Número de Gift Card es aquél que identifica a cada una de las tarjetas, está compuesto por 16 dígitos. Éste servirá para autorizar en línea las operaciones de consumo o consultas de saldo. También se incluye un número de 3 dígitos denominado Código de Seguridad. Ambos números son generados y distribuidos con los más altos estándares de seguridad que eliminan la posibilidad de duplicaciones o estafas.', 2),
	(27, 1, '¿Cómo puedo conocer el saldo de la Gift Card?', 'Es posible consultar el saldo de la tarjeta en el menú principal en la sección de “Recibiste una Gift Card” o llamando al 0810-345- 5050.', 2),
	(28, 1, '¿Dónde puedo comprar Gift Cards?', 'Las Gift Cards pueden ser adquiridas a través de nuestro sitio web www.ohgiftcard.com en la sección “Regalá” o en los propios locales de las marcas adheridas.', 2),
	(29, 1, '¿Cuál es la zona de cobertura?', 'Nuestra zona de cobertura es en todo el territorio de la República Argentina, dependiendo de la marca seleccionada.', 2),
	(30, 1, '¿Puedo realizar consumos parciales con mi Gift Card?', 'Sí, las Gift Cards permiten realizar consumos parciales por el monto que quieras hasta agotar el total del saldo o hasta que se cumpla la fecha de expiración.', 2),
	(31, 1, '¿Las Gift Cards son recargables?', 'Las oh! Gift Card no permiten ser recargadas.', 2),
	(32, 1, '¿Qué pasa si el producto o servicio que deseo comprar es superior al monto de la Gift Card?', 'En este caso, podrás abonar la diferencia con cualquier otro medio de pago aceptado por el comercio.', 2),
	(33, 1, '¿Qué pasa si se me pierde o me roban la Gift Card?', 'Al tratarse de una Gift Card emitida al portador, no será posible reponer o devolver la Gift Card.', 2),
	(34, 1, '¿Qué vigencia tienen las Gift Cards?', 'Las Gift Cards tienen una vigencia de 180 o 365 días dependiendo de la marca seleccionada.', 2),
	(35, 2, '¿Existe un monto de compra corporativa mínimo?', 'Sí, el monto mínimo para la compra corporativa es $10.000 finales.', 2),
	(36, 2, '¿Cuentan con cobertura nacional?', 'Nuestra cobertura es a nivel nacional, varía según los locales adheridos de las marcas seleccionadas.', 2),
	(37, 2, '¿Se puede personalizar el producto?', 'Sí, todos nuestros productos se pueden personalizar.', 2),
	(38, 2, '¿Las Gift Cards son nominadas?', 'No, todas nuestras Gift Cards son al portador.', 2),
	(39, 2, '¿Tienen Gift Cards para fechas o eventos corporativos?', 'Sí, tenemos Gift Cards exclusivas para eventos corporativos como Día del Niño, Día de la Secretaria, Fin de año, etc.', 2);
